		var estado = $(""#cpaPedido_""+orderId).css(""display"");
		if (estado==""none"")
		{
			//Desplegar
			$(""#cpaPedido_"" + orderId).css(""display"",""table-row"");

			//Reloj
			$(""#tdPedido_"" + orderId)
				.html(""<img src='/images/loading.gif' width='50' />"");

			//Inhabilitar
			$(""#link_"" + orderId).css(""display"",""none"");

			//Ajax
