			$.ajax
			(
				{
					url: ""/Orders/");
            WriteLiteral(@"ViewDetail"",
					data: { orderId: orderId },
					type: ""GET"",
					success: function (resp) 
					{
						//Update UI
						$(""#tdPedido_"" + orderId)
							.html(resp);
						
						$(""#link_"" + orderId).css(""display"",""block"");
					},
					error: function () 
					{
						$(""#tdPedido_"" + orderId)
							.html(""<p class='text-danger'>Se ha producido un error. Inténtelo más tarde</p>"");
						
